create table t_ord
(
    ord_seq integer not null
        constraint t_ord_pk
            primary key,
    cus_id  varchar not null
        constraint t_ord_m_cus_cus_id_fk
            references m_cus,
    ord_dt  timestamp,
    ord_st  varchar,
    pay_dt  timestamp,
    pay_tp  varchar,
    ord_amt numeric(18, 3),
    pay_amt numeric(18, 3)
);

alter table t_ord
    owner to postgres;

create unique index t_ord_ord_seq_uindex
    on t_ord (ord_seq);

